import React, { Component } from 'react';
import ReactSnap from 'react-snap-svg'

class Test extends Component {
  render() {
    return (
        <ReactSnap>
          {(s)=>{
            s.circle(150, 150, 100)
          }}
        </ReactSnap>
    );
  }
}

export default Test;
